import { View, Text } from "react-native";
import React from "react";
import { Dropdown } from "react-native-material-dropdown";

const Home = () => {
    return (
        <Dropdown
            label="Some Label"
            data={this.props.menuItems}
            containerStyle={styles.dropdownStyle}
            onChangeText={(value) => {
                this.setState({
                    selectedValue: value,
                });
            }}
        />
    );
};

export default Home;
